function formatDate (date) {
  var datePart = date.match(/\d+/g),
  year = datePart[0],
  month = datePart[1], day = datePart[2];
  return day+'/'+month+'/'+year;
}

export default function checkTrueDate(birthDate) {
  let formatedbirthDate = formatDate(birthDate)
  let dateCheck = new Date().toLocaleDateString();
  let d = formatedbirthDate.split("/");
  let c = dateCheck.split("/");

  let date = new Date(d[2], parseInt(d[1]) - 1, d[0]);
  let check = new Date(c[2], parseInt(c[1]) - 1, c[0]);

  if (check < date) {
    // console.log("A data inicial já passou");
    return "A data de nascimento que você indicou é futura";
  }
   return true;
}
